import React, { Component } from 'react';
import { Alert, Button, Card, CardBody, Col, Container, Form, Input, InputGroup, InputGroupAddon, InputGroupText, Row } from 'reactstrap';
import { login } from '../../../api/functions/UserFunctions'

class Login extends Component {

  constructor() {
     super()
     this.state = {
       email: '',
       password: '',
       errors: {},
       show: false
     }

     this.onChange = this.onChange.bind(this)
     this.onSubmit = this.onSubmit.bind(this)
   }

   onChange(e) {
     this.setState({ [e.target.name]: e.target.value })
   }

   showPopUp = (show) => {
     if (show === true)
     return(
       <div class="toast" role="alert" aria-live="assertive" aria-atomic="true">
     <div class="toast-header">
       <svg class="bd-placeholder-img rounded mr-2" width="20" height="20" xmlns="http://www.w3.org/2000/svg" preserveAspectRatio="xMidYMid slice" role="img"><rect width="100%" height="100%" fill="#007aff"/></svg>

       <strong class="mr-auto">Bootstrap</strong>
       <small class="text-muted">11 mins ago</small>
       <button type="button" class="ml-2 mb-1 close" data-dismiss="toast" aria-label="Close">
         <span aria-hidden="true">&times;</span>
       </button>
     </div>
     <div class="toast-body">
       Hello, world! This is a toast message.
     </div>
   </div>
    )
  }

   onSubmit(e) {
     e.preventDefault()

     const user = {
       email: this.state.email,
       password: this.state.password
     }

   login(user).then(res => {
     if (res) {
       this.props.history.push(`/Signals`)
     } else {
       console.log("ELSEEEEEEEEEEEEE");
       this.setState({
         show: !this.state.show
       })
     }
   })
 }

render() {
  return (
    <div className="app flex-row align-items-center">
      {this.showPopUp(this.state.show)}
      <Container>
        <Row className="justify-content-center">
          <Col md="9" lg="7" xl="6">
            <Card className="mx-4">
              <CardBody className="p-4">
                <Form noValidate onSubmit={this.onSubmit}>
                  <h1>S'identifier</h1>
                  <InputGroup className="mb-3">
                    <InputGroupAddon addonType="prepend">
                      <InputGroupText>@</InputGroupText>
                    </InputGroupAddon>
                    <Input
                    type="text"
                    placeholder="Email"
                    name="email"
                    value={this.state.email}
                    onChange={this.onChange}
                    required
                    />
                  </InputGroup>
                  <InputGroup className="mb-3">
                    <InputGroupAddon addonType="prepend">
                      <InputGroupText>
                        <i className="icon-lock"></i>
                      </InputGroupText>
                    </InputGroupAddon>
                    <Input
                    type="password"
                    placeholder="Mot de passe"
                    autoComplete="new-password"
                    name="password"
                    value={this.state.password}
                    onChange={this.onChange}
                    required/>
                  </InputGroup>
                  <Button color="success" type="submit" block>Se connecter</Button>
                </Form>
              </CardBody>
              </Card>
          </Col>
        </Row>
      </Container>
    </div>
        );
    }
}

export default Login;
